    { "x": { "type": "literal", "value": "author" }	, "authorTitle": { "type": "uri", "value": "http://dbpedia.org/resource/Masashi_Kishimoto" }	, "authorAbstract": { "type": "literal", "xml:lang": "en", "value": "Masashi Kishimoto (\u5CB8\u672C \u6589\u53F2 Kishimoto Masashi, born November 8, 1974) is a Japanese manga artist, well known for creating the manga series Naruto which was in serialization from 1999 to 2014. As of October 2015, Naruto manga has sold over 220 million copies worldwide. it is the third best-selling manga series of all time. Besides the Naruto manga, Kishimoto also participated in the making of the anime films Road to Ninja: Naruto the Movie, The Last: Naruto the Movie, Boruto: Naruto the Movie, and has written several one-shot stories. A reader of manga ever since a young age, Kishimoto showed a desire to write his own manga, citing authors Akira Toriyama and Katsuhiro Otomo as his main inspirations. As a result, Kishimoto spent several years working to write his own sh\u014Dnen manga for Weekly Sh\u014Dnen Jump magazine which he was a fan of." }	, "authorBirthDate": { "type": "typed-literal", "datatype": "http://www.w3.org/2001/XMLSchema#date", "value": "1974-11-08" }} ] } }
